question.answer:
data = {}

with open('ice-cream.csv', encoding = 'utf8') as inf:
    for line in inf:
        ice_cream = set(line.strip().split(';'))
        for i in ice_cream:
            if i not in data:
                data[i] = 1
            else:
                data[i] += 1

maxi = max(data.values())

for k, v in data.items():
    if v == maxi:
        print(k)
